import React from 'react';
import '../styles/main.css';

const About = () => {
  return (
    <div className="page-container">
      <h1>About Grinsetway</h1>
      <p>Your premier gardening resource since 2023</p>
      <section className="about-content">
        <h2>Our Mission</h2>
        <p>Helping gardeners of all levels grow beautiful, healthy plants.</p>
      </section>
    </div>
  );
};

export default About;
